import styled from "styled-components"
import { useEffect, useState } from "react"
import { CustomParagraph, CustomTitle } from "../CustomText"
import Content from "../content.json"
import IframeResizer from "iframe-resizer-react"

export const HomePage = () => {
    const [scroll, setScroll] = useState(0)

    const listenScrollEvent = (event) => {
        setScroll(window.scrollY)
    }
    useEffect(() => {
        window.addEventListener('scroll', listenScrollEvent);

        return () =>
            window.removeEventListener('scroll', listenScrollEvent);
    }, []);
    return (
        <>
            <Cover scroll={scroll} />
            <div style={{ padding: "15px", margin: "15px" }}>
                <Biography />
                <RecentNews />
            </div>

        </>

    )
}


const Cover = ({ scroll }) => {
    return (
        <>
            <CoverContainer>
                <JellyBean scroll={scroll}>

                    <svg xmlns='http://www.w3.org/2000/svg' height='100%' viewBox='0 0 3890.303 2752.572'>
                        <path id='Path_1' data-name='Path 1' d='M1698.446-70.623S1639.3,155.428,819.96,214.089-251.867,1318.881,966.628,1715.621s3015.725,52.321,3051.585-1302.1C4049.339-762.119,3006.728-1105.8,2320.371-747.287A1065.278,1065.278,0,0,0,2043.81-539.048C1882.614-292.806,1698.446-70.623,1698.446-70.623Z' transform='translate(-128.591 882.483)' fill='#FADFC6' />
                    </svg>
                </JellyBean>
                <BgName scroll={scroll}>
                    TODD AUSTIN
                </BgName>
                <Portrait>
                    <img src="./todd.png" alt="todd" width={"100%"} style={{ maxHeight: "800px" }} />
                </Portrait>
            </CoverContainer >

        </>

    )
}
const Biography = () => {
    return (

        <CustomParagraph title={"BIBLOGRAPHY"}>
            {Content.personal_biography}
        </CustomParagraph>


    )
}
const RecentNews = () => {

    const res = (iframe) => {
        // console.log("hello iframe");
        // const height = o.target.scrollHeight;
        // console.log(height)
        console.log("hello ", iframe.contentWindow);
        // o.target.style.height = "300px"
        // iframe.height = `${height}px`;
    }
    // iFrame.contentWindow.document.body.scrollWidth;

    return (
        <div style={{ margin: "50px 0px", }}>
            <CustomTitle title={"RECENT NEWS"} />
            <hr />
            <IframeResizer
                log
                src="https://www.linkedin.com/embed/feed/update/urn:li:share:6954184073858678785"
                style={{ width: '60%px', minWidth: '50%' }}
            />
            <div>
                <iframe id="iframe1" src="https://www.linkedin.com/embed/feed/update/urn:li:share:6954184073858678785" height="400px" width="50%" frameBorder="0" allowFullScreen={true} title="Embedded post"
                    onLoad={(o) => {
                        let iframe = document.getElementById('iframe1');
                        res(iframe);
                    }}
                ></iframe>
            </div>
            <div>
                <iframe src="https://www.linkedin.com/embed/feed/update/urn:li:share:6947948017572339712" height="1300" width="50%" frameBorder="0" allowFullScreen="" title="Embedded post"></iframe>
            </div>
            <div>
                <iframe src="https://www.linkedin.com/embed/feed/update/urn:li:share:6928336091674525696" height="792" width="50%" frameBorder="0" allowFullScreen="" title="Embedded post"></iframe>
            </div>
            <div>
                <iframe src="https://www.linkedin.com/embed/feed/update/urn:li:ugcPost:6922642580803391488" height="730" width="50%" frameBorder="0" allowFullScreen="" title="Embedded post"></iframe>
            </div>
            <div>
                <iframe src="https://www.linkedin.com/embed/feed/update/urn:li:share:6920036081232928769" height="1012" width="50%" frameBorder="0" allowFullScreen="" title="Embedded post"></iframe>
            </div>
        </div >
    )
}




